import styled from 'styled-components';
const Category = ({ categoryList }) => {
  return <div>{console.log(categoryList)}</div>;
};
export default Category;

const CategoryContent = styled.div`
  width: 180px;
  margin: 20px;
  padding: 30px;
  border-radius: 10px;
  background-color: rgba(10, 10, 35, 0.8);
`;
